// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract XviralShares {
    address public owner;
    uint256 public totalFeesRaised;
    uint8 public ownerFeePercentage = 5;
    uint8 public withdrawalFee = 10;
    uint256 public maxContribution = 400 ether;
    uint256 public maxDuration = 7 days;

    enum SaleType {Shares, Subscription, Both}

    enum ChangeType {OwnerFee, WithdrawalFee}

    struct Sale {
        address creator;
        uint256 targetAmount;
        uint256 totalSharesRaised;
        uint256 totalSubscriptionRaised;
        uint256 startTime;
        uint256 endTime;
        uint256 sharePrice;
        uint256 subscriptionPrice;
        SaleType saleType;
    }

    struct Contribution {
        address contributor;
        uint256 amount;
        uint256 shares;
        uint256 subscriptions;
    }

    struct TempVars{
        uint256 shareAmount;
        uint256 subscriptionAmount;
        uint256 subscriptions;
        uint256 shares;
        uint256 newSharePrice;
        uint256 avlAmount;
        uint256 withdrawalAmount;
        uint256 newTotalSharesRaised;
        uint256 fees;
        uint256 totalRaised;
    }

    mapping(uint256 => mapping(address => Contribution)) public saleContributions;

    mapping(uint256 => Sale) public sales;

    mapping(address => uint256) public balances;

    uint256 public saleCounter;

    event SaleCreated(
        uint256 indexed saleId,
        address indexed creator,
        uint256 targetAmount,
        uint256 startTime,
        uint256 endTime,
        uint256 sharePrice,
        uint256 subscriptionPrice,
        SaleType saleType
    );

    event ContributionAdded(
        uint256 indexed saleId,
        address indexed contributor,
        uint256 amount,
        uint256 shares,
        uint256 subscriptions
    );

    event SaleClosed(uint256 indexed saleId, uint256 totalSharesRaised);

    event Withdrawal(uint256 indexed saleId, address indexed contributor, uint256 amount);

    event SaleCanceled(uint256 indexed saleId);

    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);

    event FeesChanged(uint8 previousFee, uint8 indexed newFee);

    event MaxValueChanged(uint256 previousDuration, uint256 newDuration);

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can call this function");
        _;
    }

    modifier onlyCreator(uint256 _saleId) {
        require(msg.sender == sales[_saleId].creator, "Only sale creator can call this function");
        _;
    }

    modifier saleActive(uint256 _saleId) {
        require(block.timestamp >= sales[_saleId].startTime && block.timestamp <= sales[_saleId].endTime, "Sale is not active");
        _;
    }

    modifier saleNotClosed(uint256 _saleId) {
        require(block.timestamp <= sales[_saleId].endTime, "Sale is closed");
        _;
    }

    constructor() {
        owner = msg.sender;
    }

    function createSale(
        uint256 _targetAmount,
        uint256 _duration,
        uint256 _startTime,
        uint256 _sharePrice,
        uint256 _subscriptionPrice,
        SaleType _saleType
    ) external {
        _validateSaleParameters(_targetAmount, _duration, _sharePrice, _subscriptionPrice);

        uint256 endTime = _startTime + _duration;
        require(endTime <= _startTime + maxDuration, "Invalid duration");

        saleCounter++;

        Sale storage newSale = sales[saleCounter];
        _initializeSale(newSale, _targetAmount, _startTime, endTime, _sharePrice, _subscriptionPrice, _saleType);

        emit SaleCreated(saleCounter, msg.sender, _targetAmount, _startTime, endTime, _sharePrice, _subscriptionPrice, _saleType);
    }

    // Function to contribute to a sale
    function contribute(uint256 _saleId, uint16 _shareValue) external payable saleActive(_saleId) saleNotClosed(_saleId) {
        Sale storage sale = sales[_saleId];
        require(msg.value > 0, "Contribution amount must be greater than 0.");
        require(sale.totalSharesRaised + sale.totalSubscriptionRaised + msg.value < sale.targetAmount, "Sales have reached its target.");

        _processContribution(_saleId, _shareValue);
    }

    // Function to purchase shares after a sale has ended
    function purchase(uint256 _saleId, uint16 _shareValue) external payable {
        Sale storage sale = sales[_saleId];
        require(msg.value > 0, "Purchase amount must be greater than 0.");
        require(block.timestamp <= sale.startTime && block.timestamp >= sale.endTime, "Sale is still running or active.");
        require(block.timestamp >= sale.endTime, "Sale is not yet closed.");

        _processPurchase(_saleId, _shareValue);
    }

    // Function to withdraw shares
    function withdrawShares(uint256 _saleId, uint256 _numShares) external {
        Contribution storage contribution = saleContributions[_saleId][msg.sender];
        require(contribution.shares > 0 && _numShares <= contribution.shares, "Insufficient shares for withdrawal");

        _processWithdrawal(_saleId, _numShares, contribution);
    }

    function getCreatorBalance() external view returns(uint256){
        return balances[msg.sender];
    }


    // Function to transfer ownership
    function transferOwnership(address _newOwner) external onlyOwner {
        require(_newOwner != address(0), "Invalid new owner address");
        emit OwnershipTransferred(owner, _newOwner);
        owner = payable(_newOwner);
    }

    // Function to change the withdrawal fee
    function changeWithdrawalFee(uint8 value) external onlyOwner {
        _changeFee(value, withdrawalFee);
        withdrawalFee = value;
    }

    // Function to change the owner fee
    function changeOwnerFee(uint8 value) external onlyOwner {
        _changeFee(value, ownerFeePercentage);
        ownerFeePercentage = value;
    }

    // Function to change the max duration
    function changeMaxDuration(uint256 duration) external onlyOwner {
        _changeMaxParameter(duration, maxDuration);
        maxDuration = duration;
    }

    // Function to change the max contribution
    function changeMaxContribution(uint256 contribution) external onlyOwner {
        _changeMaxParameter(contribution, maxContribution);
        maxContribution = contribution;
    }

    // Internal function to change a fee parameter (withdrawalFee or ownerFeePercentage)
    function _changeFee(uint8 newValue, uint8 currentFee) internal onlyOwner {
        require(newValue != currentFee, "New value must be different from the current value");
        emit FeesChanged(currentFee, newValue);
        currentFee = newValue;
    }

    // Internal function to change a max parameter (maxDuration or maxContribution)
    function _changeMaxParameter(uint256 newValue, uint256 currentMax) internal onlyOwner {
        require(newValue != currentMax, "New value must be different from the current value");
        emit MaxValueChanged(currentMax, newValue);
        currentMax = newValue;
    }

    // Internal function to validate sale parameters
    function _validateSaleParameters(uint256 _targetAmount, uint256 _duration, uint256 _sharePrice, uint256 _subscriptionPrice) internal view {
        require(_duration <= maxDuration, "Duration exceeds maximum allowed");
        require(_targetAmount <= maxContribution, "Target amount exceeds maximum contribution per sale");
        require(_targetAmount > 0, "Target amount must be greater than 0");
        require(_sharePrice > 0 || _subscriptionPrice > 0, "Share or Subscription price must be greater than 0");
    }

    // Internal function to initialize a new sale
    function _initializeSale(
        Sale storage _sale,
        uint256 _targetAmount,
        uint256 _startTime,
        uint256 _endTime,
        uint256 _sharePrice,
        uint256 _subscriptionPrice,
        SaleType _saleType
    ) internal {
        _sale.creator = msg.sender;
        _sale.targetAmount = _targetAmount;
        _sale.startTime = _startTime;
        _sale.endTime = _endTime;
        _sale.sharePrice = _sharePrice;
        _sale.totalSharesRaised = 0;
        _sale.subscriptionPrice = _subscriptionPrice;
        _sale.saleType = _saleType;
    }

    // Internal function to process a contribution
    function _processContribution(uint256 _saleId, uint256 _shareValue) internal {
        Sale storage sale = sales[_saleId];
        TempVars memory tempVars;
        uint256 actualContribution = _calculateActualContribution(msg.value);
        tempVars.fees = msg.value - actualContribution;
        tempVars.avlAmount = actualContribution;
        tempVars.shareAmount = _shareValue * sale.sharePrice;

        _calculateContributionAmounts(_shareValue, sale, tempVars);

        Contribution storage contribution = saleContributions[_saleId][msg.sender];

        saleContributions[_saleId][msg.sender] = contribution;

        _updateBalancesAndTotals(sale, contribution, tempVars);

        _checkSaleClosed(_saleId, tempVars.totalRaised);
    }

    // Internal function to process a purchase
    function _processPurchase(uint256 _saleId, uint16 _shareValue) internal {
        Sale storage sale = sales[_saleId];
        TempVars memory tempVars;
        uint256 actualContribution = _calculateActualContribution(msg.value);
        tempVars.fees = msg.value - actualContribution;
        tempVars.avlAmount = actualContribution;
        tempVars.shareAmount = _shareValue * sale.sharePrice;

        _calculateContributionAmounts(_shareValue, sale, tempVars);

        Contribution storage contribution = saleContributions[_saleId][msg.sender];

        tempVars.newTotalSharesRaised = sale.totalSharesRaised + tempVars.shareAmount;

        _updateBalancesAndTotals(sale, contribution, tempVars);

        sale.sharePrice = _calculateNewSharePrice(sale, tempVars);

        emit ContributionAdded(_saleId, msg.sender, tempVars.avlAmount, tempVars.shares, tempVars.subscriptions);
    }

    // Internal function to process a withdrawal
    function _processWithdrawal(uint256 _saleId, uint256 _numShares, Contribution storage _contribution) internal {
        Sale storage sale = sales[_saleId];
        TempVars memory tempVars;
        uint256 totalAmount = _numShares * sale.sharePrice;

        _calculateWithdrawalAmount(_saleId, totalAmount, _contribution, tempVars);

        _updateBalancesAndTotals(sale, _contribution, tempVars);

        emit Withdrawal(_saleId, msg.sender, tempVars.withdrawalAmount);
    }

    // Internal function to calculate actual contribution after fees
    function _calculateActualContribution(uint256 _contribution) internal view returns (uint256) {
        return (_contribution * 100) / (ownerFeePercentage + 100);
    }

    // Internal function to calculate various contribution amounts
    function _calculateContributionAmounts(uint256 _shareValue, Sale storage _sale, TempVars memory _tempVars) internal view {
        if (_tempVars.shareAmount <= _tempVars.avlAmount) {
            _tempVars.subscriptionAmount = _tempVars.avlAmount - _tempVars.shareAmount;
            _tempVars.subscriptions = (_tempVars.subscriptionAmount + 1) / _sale.subscriptionPrice;
            _tempVars.shares = _shareValue;
        } else {
            _tempVars.shares = _tempVars.avlAmount / _sale.sharePrice;
            _tempVars.subscriptionAmount = _tempVars.avlAmount - (_tempVars.shares * _sale.sharePrice);
            _tempVars.subscriptions = (_tempVars.subscriptionAmount + 1) / _sale.subscriptionPrice;
        }
    }

    // Internal function to update balances and totals
    function _updateBalancesAndTotals(Sale storage _sale, Contribution storage _contribution, TempVars memory _tempVars) internal {
        _updateFeesAndBalances(_sale, _tempVars);

        _contribution.shares += _tempVars.shares;
        _contribution.subscriptions += _tempVars.subscriptions;
        _contribution.amount += _tempVars.avlAmount;
        _contribution.contributor = msg.sender;

        _updateSaleTotals(_sale, _tempVars);
    }

    // Internal function to update fees and balances
    function _updateFeesAndBalances(Sale storage _sale,TempVars memory _tempVars) internal {
        balances[_sale.creator] += (_tempVars.fees / 2) + (_tempVars.subscriptionAmount / 2);
        totalFeesRaised += (_tempVars.fees / 2) + (_tempVars.subscriptionAmount * 20 / 100);
    }

    // Internal function to update sale totals
    function _updateSaleTotals(Sale storage _sale, TempVars memory _tempVars) internal {
        _sale.totalSharesRaised += _tempVars.shareAmount + (_tempVars.subscriptionAmount * 10 / 100);
        _sale.totalSubscriptionRaised += _tempVars.subscriptionAmount;
    }

    // Internal function to calculate a new share price after a purchase
    function _calculateNewSharePrice(Sale storage _sale, TempVars memory _tempVars) internal view returns (uint256) {
        if (_tempVars.newTotalSharesRaised != _sale.targetAmount) {
            return (_tempVars.newTotalSharesRaised * _sale.sharePrice) / _sale.targetAmount;
        } else {
            return _sale.sharePrice;
        }
    }

    // Internal function to check if a sale is closed
    function _checkSaleClosed(uint256 _saleId, uint256 _totalRaised) internal {
        if (_totalRaised >= sales[_saleId].targetAmount) {
            emit SaleClosed(_saleId, _totalRaised);
        }
    }

    // Internal function to calculate withdrawal amount
    function _calculateWithdrawalAmount(uint256 _saleId, uint256 _totalAmount, Contribution storage _contribution, TempVars memory _tempVars) internal {
        Sale storage sale = sales[_saleId];

        if (block.timestamp <= sale.startTime && block.timestamp >= sale.endTime) {
            _tempVars.withdrawalAmount = _totalAmount - (_totalAmount * withdrawalFee) / 100;
            _updateOwnerFees(_tempVars.withdrawalAmount);
        } else {
            _tempVars.withdrawalAmount = _totalAmount - (_totalAmount * ownerFeePercentage) / 100;
            _updateOwnerFees(_tempVars.withdrawalAmount);
        }

        _tempVars.newTotalSharesRaised = sale.totalSharesRaised - _tempVars.withdrawalAmount;
        _tempVars.newSharePrice = _calculateNewSharePrice(sale, _tempVars);

        _contribution.shares -= _tempVars.withdrawalAmount / sale.sharePrice;
        sale.totalSharesRaised = _tempVars.newTotalSharesRaised;
        sale.sharePrice = _tempVars.newSharePrice;

        payable(msg.sender).transfer(_tempVars.withdrawalAmount);
        emit Withdrawal(_saleId, msg.sender, _tempVars.withdrawalAmount);
    }

    // Internal function to update owner fees
    function _updateOwnerFees(uint256 _feeAmount) internal {
        balances[owner] += _feeAmount / 2;
        totalFeesRaised += _feeAmount / 2;
    }

    function getSaleDetails(uint256 _saleId)
        external
        view
        returns (
            address creator,
            uint256 targetAmount,
            uint256 startTime,
            uint256 endTime,
            uint256 sharePrice,
            uint256 subscriptionPrice,
            uint256 totalSharesRaised,
            uint256 totalSubscriptionRaised,
            SaleType saleType
        )
    {
        Sale storage sale = sales[_saleId];
        return (
            sale.creator,
            sale.targetAmount,
            sale.startTime,
            sale.endTime,
            sale.sharePrice,
            sale.subscriptionPrice,
            sale.totalSharesRaised,
            sale.totalSubscriptionRaised,
            sale.saleType
        );
    }

    function getContributionsByUser(uint256 _saleId, address _user)
        external
        view
        returns (Contribution[] memory userContributions)
    {
        uint256 contributionCount = 0;

        for (uint256 i = 1; i <= saleCounter; i++) {
            if (saleContributions[_saleId][_user].amount > 0) {
                contributionCount++;
            }
        }

        userContributions = new Contribution[](contributionCount);
        contributionCount = 0;

        for (uint256 i = 1; i <= saleCounter; i++) {
            if (saleContributions[_saleId][_user].amount > 0) {
                userContributions[contributionCount] = saleContributions[_saleId][_user];
                contributionCount++;
            }
        }

        return userContributions;
    }

    function getAllSales() external view returns (Sale[] memory) {
        Sale[] memory allSales = new Sale[](saleCounter);

        for (uint256 i = 1; i <= saleCounter; i++) {
            allSales[i - 1] = sales[i];
        }

        return allSales;
    }

}
